using System;
using Microsoft.VisualStudio.TestTools.UnitTesting;
using Bioinformatics;
using System.Linq;

namespace BioTest
{
    [TestClass]
    public class ReverseComplementTests
    {
        [TestMethod]
        public void ReverseComplement_Simple()
        {
            NucleotideDna strand = new NucleotideDna("AAAACCCGGT");
            NucleotideDna reverse = strand.ReverseComplement();

            Assert.AreEqual("ACCGGGTTTT", reverse.ToString());
        }


        [TestMethod]
        public void ReverseComplement_Test1()
        {
            NucleotideDna strand = new NucleotideDna("ACACAC");
            NucleotideDna reverse = strand.ReverseComplement();

            Assert.AreEqual("GTGTGT", reverse.ToString());
        }


        [TestMethod]
        public void ReverseComplement_Test2()
        {
            NucleotideDna strand = new NucleotideDna("");
            NucleotideDna reverse = strand.ReverseComplement();

            Assert.AreEqual("", reverse.ToString());
        }


        [TestMethod]
        public void ReverseComplement_Test3()
        {
            NucleotideDna strand = Load.LoadStrand("datasets//reverseComplement_dataset.txt");
            NucleotideDna reverse = strand.ReverseComplement();

            Assert.AreEqual("", reverse.ToString());
        }
    }
}
